import React from 'react';

import styles from './HomePage.module.css';

function HomePage(props) {
    return(
        <React.Fragment>
            <div className={styles['core-content']}>
                <div className={styles.about}>
                    <img alt="My Photo" className={styles['my-image']} src="https://media-exp1.licdn.com/dms/image/C4E03AQGji9lWkNw1yg/profile-displayphoto-shrink_800_800/0/1600437083110?e=1624492800&v=beta&t=X0KG4lXc93WGXdceUKz6lo4k0K_Y9Gu2Lo81oUZluRk"/>
                    <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Id ducimus qui, nulla aspernatur quidem quos illo dignissimos blanditiis eveniet, rerum necessitatibus recusandae suscipit, repudiandae reiciendis eligendi ea. Dicta illo, quo molestias nemo tenetur ex ratione nesciunt harum cupiditate quidem nobis, necessitatibus est deleniti architecto autem! Dignissimos corrupti optio aut laborum?</p>
                </div>
            </div>
        </React.Fragment>
    );
};

export default HomePage;
